script: |
  super -f tsv -I q12332.sql | sort > q12332.out

vector: true

inputs:
  - name: q12332.sql
    data: |
      SELECT + COUNT ( * ) FROM tab1 WHERE NOT CAST ( + - 54 AS INTEGER ) * - CAST ( + 8 AS INTEGER ) NOT BETWEEN + + ( + ( - CAST ( col0 AS INTEGER ) ) ) * + 54 AND - - col2 * + col2 + - CAST ( col1 AS INTEGER ) / col0;
  - name: tab1

outputs:
  - name: q12332.out
    data: |
      3
